import { BrowserRouter,Routes, Route } from 'react-router-dom';
import Home from './Home/Home';
import './App.css';

const App= ()=> (

  <BrowserRouter>
  <Routes>
  <Route path="/" element={<Home/>}></Route>
  </Routes>
  </BrowserRouter>
)

export default App;
